import React from 'react';
import Home from 'src/componentes/Home/Home';
import SobreEmpresa from 'src/componentes/SobreEmpresa/SobreEmpresa';
import Servicos from 'src/componentes/Servicos/Servicos';
import Projetos from 'src/componentes/Projetos/Projetos';
import Contato from 'src/componentes/Contato/Contato';

function PaginaPrincipal() {
    return (
        <div>
            <Home />
            <SobreEmpresa />
            <Servicos />
            <Projetos />
            <Contato />
        </div>
    );
}

export default PaginaPrincipal;
